INSERT INTO `phiminsert` VALUES (1282,'Ban tay diet quy 1','ban-tay-diet-quy','https://www.youtube.com/embed/uqJ9u7GSaYM','Newlywed couple Ted and Tami-Lynn want to have a baby, but in order to qualify to be a parent, Ted will have to prove he\'s a person in a court of law. 1','GP09','2023-07-03T06:03:00.000Z',5,_binary 'data:image/jpeg;base64,','Việt Nam','Hà Châu','Châu Hà',3,'2D'),(1322,'John Wick','john-wick','https://www.youtube.com/embed/XGk2EfbD_Ps','Mạng đổi mạng là một bộ phim hành động Mỹ sản xuất năm 2014, được đạo diễn bởi Chad Stahelski. Phim có sự tham gia của các diễn viên Keanu Reeves, Michael Nyqvist, Alfie Allen, Adrianne Palicki, Bridget Moynahan, Ian McShane, Willem Dafoe, John Leguizamo ','GP09','2022-01-24T21:00:00.000Z',10,_binary 'data:image/jpeg;base64,','Việt Nam','Hà Châu','Châu Hà',3,'2D');
INSERT INTO `phiminsert` VALUES (1345,'1',NULL,'https://www.youtube.com/watch?v=bbh51DCUKYY','Newlywed couple Ted and Tami-Lynn want to have a baby, but in order to qualify to be a parent, Ted will have to prove he\'s a person in a court of law. 1','GP09','2023-06-29T22:22:59.112Z',NULL,_binary 'data:image/jpeg;base64,','Việt Nam','Hà Châu','Châu Hà',3,'2D');
INSERT INTO `phiminsert` VALUES (1346,'Harry Poster',NULL,'https://www.youtube.com/embed/TxTiuStmdlU?si=o0nLBMmRtOvVnZbL','The whole experience was filled with laughter, bonding, and adventure. We shared stories around the campfire, played card games, and stargazed at night. I remember feeling a deep sense of joy and contentment being surrounded by my loved ones and being in such a beautiful natural setting.\n\nWhat made this experience even more special was the absence of technology. We disconnected from our phones and gadgets, allowing us to fully appreciate the simplicity and tranquility of the outdoors. It was a time of genuine connection, where we laughed, explored, and created lasting memories together.','GP09','2023-10-23T05:14:00.000Z',5,_binary 'data:image/png;base64,','Việt Nam','Hà Châu','Châu Hà',3,'2D');
INSERT INTO `phiminsert` VALUES (1347,'Hello Phim',NULL,'https://www.youtube.com/embed/uqJ9u7GSaYM','In our busy lives, it\'s crucial to remember to treat others with compassion and understanding. Small acts of kindness can make a big difference','GP09','2023-10-31T23:33:12.417Z',NULL,_binary 'data:image/jpeg;base64,','Việt Nam','Hà Châu','Châu Hà',3,'2D');
